import '../'


export default class Navigation extends Component {
    render() {
        return (
           <div className="nav">
               <ul className="nav__menu">
               <li className="nav__menu-item">
                     <a><h1></h1></a>
                     <div><ul className="nav__submenu">
                         
                         <li className="nav__submenu-item ">aaaaaaa</li>
                         <li className="nav__submenu-item ">bbbbbbbb</li>
                         <li className="nav__submenu-item ">ccccccc</li>
                         
                         </ul></div>
               </li>
               </ul>
           </div>
        )
    }
}
